import React from "react";
import AddImageForm from "./AddImageForm";

const AddImages = (props) => {
    return (
        <div className="container">
        <div className="d-flex justify-content-center mt-4 flex-coloum">
            <div>
                <button className="btn btn-primary btn-lg">ADD IMAGE</button>
            </div>
            <div>
                <AddImageForm/>
            </div>
        </div>
        </div>
    );
}
export default AddImages;
